            content: "Ocultos por la niebla protectora de Venus, Eneas y Acates llegan a un punto elevado desde el que observan la frenética actividad de Cartago. Contemplan con admiración cómo se levantan las murallas, se trazan las calles y se construyen los edificios. Virgilio compara a los trabajadores tirios con una colonia de abejas en primavera, cada una ocupada en su tarea para el bien común. Eneas, con una mezcla de envidia y esperanza, exclama: '¡Oh, afortunados, cuyas murallas ya se elevan!'. Protegido por el manto divino, se adentra en la ciudad sin ser visto."
